export default function Header() {
  return (
    <div class="posts">
      <div class="post">
        <h1 class="titulo">High five, Hyperlink!</h1>
        <img src="img/hyperlink.webp" alt="Hyperlink" />
      </div>
      <div class="post">
        <h1 class="titulo">Sorry, bro.</h1>
        <img src="img/sorry_bro.webp" alt="Sorry, bro." />
      </div>
    </div>
  );
}
